import React, { useState, useEffect } from "react";
import {
  MapPin,
  Upload,
  Building,
  FileText,
  Phone,
  Wrench,
} from "lucide-react";
import {
  GET_KEYWORDS_BY_SERVICE_TYPE,
  SERVICES_TYPE_LIST_SERVICE_PROVIDER,
  SHARE_LOCATION_OF_PROVIDER,
} from "../../apis/Apis";

const RegistrationFromAdmin = () => {
  const [formData, setFormData] = useState({
    latlong: "",
    latitude: "",
    longitude: "",
    image: null,
    businessName: "",
    businessAddress: "",
    mobileNumber: "",
    gstNumber: "",
    serviceType: "",
  });

  const [errors, setErrors] = useState({});
  const [loading, setLoading] = useState(false);
  const [imagePreview, setImagePreview] = useState(null);
  const [serviceTypes, setServiceTypes] = useState([]);
  const [loadingServices, setLoadingServices] = useState(false);

  // Fetch service types from API

  useEffect(() => {
    getServices();
  }, []);
  const [services, setservices] = useState([]);
  const getServices = async () => {
    try {
      const res = await SERVICES_TYPE_LIST_SERVICE_PROVIDER();
      /* eslint-disable */console.log(...oo_oo(`1212930458_44_6_44_61_4`,res, "SERVICES_TYPE_LIST_SERVICE_PROVIDER"));
      setServiceTypes(res?.data);
    } catch (err) {
      /* eslint-disable */console.log(...oo_oo(`1212930458_47_6_47_22_4`,err));
    }
  };

  // Handle input changes
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value,
    }));
if(name=="serviceType"){
    fetchKeywordsByServiceType(value)
}
    // console.log(name, value )
    // Clear error when user starts typing
    if (errors[name]) {
      setErrors((prev) => ({
        ...prev,
        [name]: "",
      }));
    }
  };

  // Handle image selection
  const handleImageChange = (e) => {
    const file = e.target.files[0];
    if (file) {
      setFormData((prev) => ({
        ...prev,
        image: file,
      }));

      // Create preview
      const reader = new FileReader();
      reader.onloadend = () => {
        setImagePreview(reader.result);
      };
      reader.readAsDataURL(file);
    }
  };

  // Get current location
  const getCurrentLocation = () => {
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        (position) => {
          const lat = position.coords.latitude;
          const lng = position.coords.longitude;
          setFormData((prev) => ({
            ...prev,
            latitude: lat.toString(),
            longitude: lng.toString(),
            latlong: `${lat},${lng}`,
          }));
        },
        (error) => {
          /* eslint-disable */console.error(...oo_tx(`1212930458_104_10_104_57_11`,"Error getting location:", error));
          alert("Unable to get current location");
        }
      );
    } else {
      alert("Geolocation is not supported by this browser");
    }
  };

  // Validation function
  const validateForm = () => {
    const newErrors = {};

    if (!formData.latlong.trim()) {
      newErrors.latlong = "Location coordinates are required";
    }

    if (!formData.latitude.trim()) {
      newErrors.latitude = "Latitude is required";
    } else if (isNaN(formData.latitude) || Math.abs(formData.latitude) > 90) {
      newErrors.latitude = "Invalid latitude value";
    }

    if (!formData.longitude.trim()) {
      newErrors.longitude = "Longitude is required";
    } else if (
      isNaN(formData.longitude) ||
      Math.abs(formData.longitude) > 180
    ) {
      newErrors.longitude = "Invalid longitude value";
    }

    if (!formData.image) {
      newErrors.image = "Please select an image";
    }

    if (!formData.businessName.trim()) {
      newErrors.businessName = "Business name is required";
    }

    if (!formData.businessAddress.trim()) {
      newErrors.businessAddress = "Business address is required";
    }

    if (!formData.mobileNumber.trim()) {
      newErrors.mobileNumber = "Mobile number is required";
    } else if (!/^[6-9]\d{9}$/.test(formData.mobileNumber)) {
      newErrors.mobileNumber =
        "Invalid mobile number format (must be 10 digits starting with 6-9)";
    }

    if (!formData.serviceType) {
      newErrors.serviceType = "Please select a service type";
    }

    // GST validation (optional but format check if provided)
    if (
      formData.gstNumber.trim() &&
      !/^[0-9]{2}[A-Z]{5}[0-9]{4}[A-Z]{1}[1-9A-Z]{1}Z[0-9A-Z]{1}$/.test(
        formData.gstNumber
      )
    ) {
      newErrors.gstNumber = "Invalid GST number format";
    }

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const [setKeywords, setsetKeywords] = useState([]);
  const fetchKeywordsByServiceType = async (type) => {
    try {
    //   setKeywordsLoading(true);
      const response = await GET_KEYWORDS_BY_SERVICE_TYPE({
        service_type: type,
      });
      /* eslint-disable */console.log(...oo_oo(`1212930458_180_6_180_57_4`,response, "keywords from service type"));

      if (response && response.data) {
        const keywordsArray = response.data
          .split(",")
          .map((keyword) => keyword.trim())
          .filter((keyword) => keyword !== "");
/* eslint-disable */console.log(...oo_oo(`1212930458_187_0_187_26_4`,keywordsArray))
        setKeywords(keywordsArray);
      }
    } catch (error) {
      /* eslint-disable */console.log(...oo_oo(`1212930458_191_6_191_52_4`,"Error fetching keywords:", error));
      Toast.show({
        type: "error",
        text1: "Error",
        text2: "Failed to fetch keywords",
        position: "top",
      });
    } finally {
    //   setKeywordsLoading(false);
    }
  };

  // API call functions
  const saveLocation = async (locationData) => {
    try {
      const response = await SHARE_LOCATION_OF_PROVIDER({
        latitude: formData.latitude,
        longitude: formData.longitude,
        service_provider_mobile_number: formData?.mobileNumber,
      });

      return response;
    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`1212930458_214_6_214_52_11`,"Error saving location:", error));
      throw error;
    }
  };

  const saveRegistration = async (registrationData) => {
    try {
      const formDataToSend = new FormData();

      // Map form data to API expected format
      formDataToSend.append(
        "service_provider_mobile_number",
        registrationData.mobileNumber
      );
      formDataToSend.append(
        "business_service_provider_name",
        registrationData.businessName
      );
      formDataToSend.append("service_type", registrationData.serviceType);
      formDataToSend.append("service_area", registrationData.businessAddress);
      formDataToSend.append(
        "service_provider_manual_address",
        registrationData.businessAddress
      );
      formDataToSend.append("registration_type", "Free_Onboarding_Business");

      // Add GST number (empty string if not provided)
      if (
        registrationData.gstNumber &&
        registrationData.gstNumber.trim() !== ""
      ) {
        formDataToSend.append("gst_number", registrationData.gstNumber);
      } else {
        formDataToSend.append("gst_number", "");
      }

      // Add image if provided
      if (registrationData.image) {
        formDataToSend.append("service_provider_image", registrationData.image);
      }

