                    <div className="mt-3">
                      <img
                        src={imagePreview}
                        alt="Preview"
                        className="img-thumbnail"
                        style={{
                          width: "150px",
                          height: "150px",
                          objectFit: "cover",
                        }}
                      />
                    </div>
                  )}
                </div>

                {/* Business Details */}
                <div className="mb-4">
                  <label className="form-label d-flex align-items-center">
                    <Building className="me-2" size={16} />
                    Business Name *
                  </label>
                  <input
                    type="text"
                    name="businessName"
                    value={formData.businessName}
                    onChange={handleInputChange}
                    placeholder="Enter business name"
                    className={`form-control ${
                      errors.businessName ? "is-invalid" : ""
                    }`}
                  />
                  {errors.businessName && (
                    <div className="invalid-feedback">
                      {errors.businessName}
                    </div>
                  )}
                </div>

                {/* Business Address */}
                <div className="mb-4">
                  <label className="form-label">
                    Business Manual Address *
                  </label>
                  <textarea
                    name="businessAddress"
                    value={formData.businessAddress}
                    onChange={handleInputChange}
                    placeholder="Enter complete business address"
                    rows="3"
                    className={`form-control ${
                      errors.businessAddress ? "is-invalid" : ""
                    }`}
                  />
                  {errors.businessAddress && (
                    <div className="invalid-feedback">
                      {errors.businessAddress}
                    </div>
                  )}
                </div>

                {/* Mobile Number */}
                <div className="mb-4">
                  <label className="form-label d-flex align-items-center">
                    <Phone className="me-2" size={16} />
                    Mobile Number *
                  </label>
                  <input
                    type="tel"
                    name="mobileNumber"
                    value={formData.mobileNumber}
                    onChange={handleInputChange}
                    placeholder="Enter 10-digit mobile number"
                    maxLength="10"
                    className={`form-control ${
                      errors.mobileNumber ? "is-invalid" : ""
                    }`}
                  />
                  {errors.mobileNumber && (
                    <div className="invalid-feedback">
                      {errors.mobileNumber}
                    </div>
                  )}
                  <div className="form-text">
                    Enter 10-digit mobile number starting with 6, 7, 8, or 9
                  </div>
                </div>

                {/* GST Number */}
                <div className="mb-4">
                  <label className="form-label d-flex align-items-center">
                    <FileText className="me-2" size={16} />
                    GST Number (Optional)
                  </label>
                  <input
                    type="text"
                    name="gstNumber"
                    value={formData.gstNumber}
                    onChange={handleInputChange}
                    placeholder="Enter GST number (if applicable)"
                    className={`form-control ${
                      errors.gstNumber ? "is-invalid" : ""
                    }`}
                  />
                  {errors.gstNumber && (
                    <div className="invalid-feedback">{errors.gstNumber}</div>
                  )}
                  <div className="form-text">
                    Format: 22AAAAA0000A1Z5 (Leave blank if not applicable)
                  </div>
                </div>

                {/* Submit Button */}
                <div className="d-grid">
                  <button
                    onClick={handleSubmit}
                    disabled={loading}
                    className={`btn btn-lg ${
                      loading ? "btn-secondary" : "btn-primary"
                    }`}
                  >
                    {loading ? (
                      <>
                        <span
                          className="spinner-border spinner-border-sm me-2"
                          role="status"
                          aria-hidden="true"
                        ></span>
                        Processing...
                      </>
                    ) : (
                      "Submit Registration"
                    )}
                  </button>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Bootstrap JS */}
      <script src="https://cdnjs.cloudflare.com/ajax/libs/bootstrap/5.3.0/js/bootstrap.bundle.min.js"></script>
    </>
  );
};

